import Container from 'react-bootstrap'

function App() {
  return (
    <Router>
      <Header />
      <main>
        <Container>
          <Route exact path="/" component={HomeScreen} />
        </Container>
      </main>
      <Footer />
    </Router>
  );
}

export default App;
